import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../styles/home.css";
import Navbar from "../components/Navbar";


function Home() {

  return (
    <>
    <Navbar page="HOME" />

    <div className="home">

      <div className="video-container">
        <video autoPlay loop muted className="background-video">
          <source src="/assets/ml_v1.mp4" type="video/mp4" />
        </video>
        <div className="centered-text-container">
          <img src="/assets/images/mfaw.png" alt="Centered Text" className="centered-text" />
        </div>
        <div className="sticking-out-container">
            <img src="/assets/images/sticking-out-1.png" alt="Left Image" className="sticking-out-image left" />
            <img src="/assets/images/sticking-out-2.png" alt="Center Image" className="sticking-out-image center" />
            <img src="/assets/images/sticking-out-3.png" alt="Right Image" className="sticking-out-image right" />
        </div>
      </div>

    </div>
    </>
  );
}

export default Home;
